import "./Tours.css";
function Tours(props){
    return(
        <>
        <div className="content">
       {props.data.map(obj=>{
           return(
        <div>

        <p>Name: {obj.name}</p>
        <img src={obj.image} alt={obj.name}/>
        </div>
           );
        })}
        </div>
        </>
    );
}
export default Tours;
